import React from "react";

export const Image = ({ title, largeImage, smallImage }) => (
  <div className="portfolio-item">
    <div className="gallery-image">
      <img src={smallImage} alt={title} />
      <div className="overlay">
        <div>{title}</div>
      </div>
    </div>
  </div>
);
